import React from  'react'
import { WrapButtonAnel, StylesButtonAnel} from "./styles";
import { useHistory } from 'react-router-dom';

const ButtonLogoAnel: React.FC = () => {
  const timeElapsed = Date.now();
  const today = new Date(timeElapsed);
  today.toDateString(); // "Sun Jan 30 2022"

  const history = useHistory();
  const handleClick = () => {
    history.push('/entrar')
  }  

  return (
    <WrapButtonAnel>
      <StylesButtonAnel className="button" onClick={handleClick}>{today}</StylesButtonAnel>
    </WrapButtonAnel>

  )
}

export default ButtonLogoAnel
